        return (
            <div className="customerOptions">
                <div className="checkin">
                    <Button>CheckIn</Button>
                </div>
                <div className="checkout">
                    <Button>Checkout</Button>
                </div>
            </div>
        )
    }
}

export default CustomerOptions;
